import React, { useState, useEffect } from "react";
import { Route, Switch } from "react-router-dom";
import About from "./About.js";
import AddContact from "./AddContact.js";
import ContactContainer from "./ContactContainer.js";
import ContactRequests from "./ContactRequests.js";
import Header from "./Header.js";
import Login from "./Login.js";
import MyContactCard from "./MyContactCard.js";
import SignUp from "./SignUp.js";

function App() {

    const [loginData, setLogIn] = useState({username: "", password: ""});
    const [userData, setUserData] = useState([]);

    useEffect(() => {
        fetch("http://localhost:3000/users")
        .then((response) => response.json())
        .then((data) => setUserData(data))
    });

    function handleLogin(logInUsername, logInPassword) {
        return setLogIn({username: logInUsername, password: logInPassword})
    };

    return (
        <div>
            <Header />
            <Switch>
                <Route path="/login">
                    <Login handleLogin={handleLogin} loginData={loginData}/>
                </Route>
                <Route path="/contacts">
                    <ContactContainer />
                </Route>
                <Route path="/mycard">
                    <MyContactCard />
                </Route>
                <Route path="/requests">
                    <ContactRequests />
                </Route>
                <Route path="/addcontact">
                    <AddContact />
                </Route>
                <Route path="/signup">
                    <SignUp />
                </Route>
                <Route path="/">
                    <About />
                </Route>
            </Switch>
        </div>
    );
}

export default App;
